"""This data preparation is primordial to handle the missing and abnormal values, and decide on appropriate handling strategies. Our datasets are quite clean, we don't have any missing values and we did not have too much pre-processing to do. This verification allowed us to be sure that our further analysis could be correct.

Our work here consisted in converting date and encoding the categorical values. We did some feature engineering too in order to create new insights in our dataset.

Now that our datasets are clean, it's time to merge them to create one usable dataset in our report. We will map the data so we can map the region to the state, as the 2 columns are not the same. We need to standardize the column format.
"""

region_to_state = {
    "northeast": [
        "Maine", "New Hampshire", "Vermont", "Massachusetts", "Rhode Island", "Connecticut",
        "New York", "New Jersey", "Pennsylvania"
    ],
    "southeast": [
        "Delaware", "Maryland", "West Virginia", "Virginia", "Kentucky", "Tennessee",
        "North Carolina", "South Carolina", "Georgia", "Florida", "Alabama",
        "Mississippi", "Arkansas", "Louisiana", "District Of Columbia", "Puerto Rico"
    ],
    "southwest": [
        "Texas", "Oklahoma", "New Mexico", "Arizona", "Nevada", "Utah", "California", "Colorado"
    ],
    "northwest": [
        "Washington", "Oregon", "Idaho", "Montana", "Wyoming", "North Dakota", "South Dakota",
        "Nebraska", "Kansas", "Missouri", "Iowa", "Minnesota", "Wisconsin", "Illinois",
        "Indiana", "Ohio", "Michigan", "Alaska", "Hawaii"
    ]
}

def assign_region(state):
    for region, states in region_to_state.items():
        if state in states:
            return region
    return None

df_air["region"] = df_air["state_name"].apply(assign_region)

