"""We can create some feature interactions too. This might be useful to understnad key insights and relations between values. We want to analyse the interactions that we think are the most important, to confirm or infirm our analysis."""

df_merged1['bmi_aqi'] = df_merged1['bmi'] * df_merged1['aqi']
