"""AQI is very interesting for us, as this is the indicator for pollution. But its meaning might be  a little bit difficult to understand, as this is not a common indicator known by anyone. Let's create some indications to analyse the AQI"""

def categorize_aqi(aqi):
    if aqi <= 50:
        return 'Good'
    elif aqi <= 100:
        return 'Moderate'
    elif aqi <= 150:
        return 'Unhealthy for Sensitive Groups'
    elif aqi <= 200:
        return 'Unhealthy'
    elif aqi <= 300:
        return 'Very Unhealthy'
    else:
        return 'Hazardous'

df_merged1['aqi_category'] = df_merged1['aqi'].apply(categorize_aqi)

