"""It confirms that smokers have higher medical costs across all age groups. We can also see that age is important as medical charges increase with age (also for smokers)
Non-smokers aged 18-25 are in this case a low-risk insurance group, while smokers 56-65 are a major risk.

LifeSure could decide to encourage young people to remain non-smokers through discounts in their policies for example and introduce targeted smoking cessation programs to reduce long-term risks as this will lead to less charges at the end.

As we saw, we have strong variations in AQI depending on the region we're in. Let's see if this impacts insurance claims and medical charges.
"""

plt.figure(figsize=(10,5))
sns.scatterplot(data=df_merged, x="aqi", y="charges", hue="smoker", alpha=0.6)
plt.title("Impact of AQI on Medical Charges")
plt.show()

plt.figure(figsize=(10, 5))
sns.regplot(data=df_merged, x="aqi", y="charges", scatter_kws={'alpha': 0.5}, line_kws={"color": "red"})
plt.title("Trend of Medical Charges with Increasing AQI Levels")
plt.xlabel("Air Quality Index (AQI)")
plt.ylabel("Medical Charges")
